import React from "react";

//Components
import Stage from "./Stage";
import Display from "./Display";
import StartButton from "./StartButton";
import { createStage } from "../gameHelpers";

const Tetris = () => {

  return (
    <StyledTetrisWrapper>
      <Stage stage={createStage()}/>
      <aside>
        <div>
          <Display text="Score"/>
          <Display text="Rows"/>
          <Display text="Level"/>
        </div>
        <StartButton />
      </aside>
    </StyledTetrisWrapper>
  )
}

export default Tetris;
